import { Component, OnInit } from '@angular/core';
import { FormBuilder, FormGroup, Validators } from '@angular/forms';
import { Router } from '@angular/router';
import { LoadingController, ToastController } from '@ionic/angular';

import { AuthService } from '../../../services/auth.service';

@Component({
  selector: 'app-forgot-password',
  templateUrl: './forgot-password.page.html',
  styleUrls: ['./forgot-password.page.scss'],
})
export class ForgotPasswordPage implements OnInit {
  forgotPasswordForm: FormGroup;
  loading = false;

  constructor(
    private formBuilder: FormBuilder,
    private authService: AuthService,
    private router: Router,
    private loadingController: LoadingController,
    private toastController: ToastController
  ) {
    this.forgotPasswordForm = this.createForm();
  }

  ngOnInit() {}

  private createForm(): FormGroup {
    return this.formBuilder.group({
      email: ['', [Validators.required, Validators.email]]
    });
  }

  async onSubmit() {
    if (this.forgotPasswordForm.valid) {
      this.loading = true;
      const loading = await this.loadingController.create({
        message: 'Enviando...',
        duration: 10000
      });
      await loading.present();

      try {
        const email = this.forgotPasswordForm.get('email')?.value;
        await this.authService.requestPasswordReset(email).toPromise();
        
        await this.showSuccessToast('Se o email estiver cadastrado, você receberá um código de recuperação.');
        this.router.navigate(['/reset-password']);
      } catch (error: any) {
        await this.showErrorToast(error.message || 'Erro ao solicitar recuperação');
      } finally {
        this.loading = false;
        await loading.dismiss();
      }
    }
  }

  goToLogin() {
    this.router.navigate(['/login']);
  }

  private async showSuccessToast(message: string) {
    const toast = await this.toastController.create({
      message,
      duration: 5000,
      position: 'top',
      color: 'success'
    });
    await toast.present();
  }

  private async showErrorToast(message: string) {
    const toast = await this.toastController.create({
      message,
      duration: 4000,
      position: 'top',
      color: 'danger'
    });
    await toast.present();
  }
}
<ion-header [translucent]="true">
  <ion-toolbar>
    <ion-buttons slot="start">
      <ion-back-button defaultHref="/login"></ion-back-button>
    </ion-buttons>
    <ion-title>Recuperar Senha</ion-title>
  </ion-toolbar>
</ion-header>

<ion-content [fullscreen]="true">
  <div class="forgot-password-container">
    <div class="header-section">
      <ion-icon name="mail-outline" class="header-icon"></ion-icon>
      <h1>Esqueceu sua senha?</h1>
      <p>Digite seu email para receber o código de recuperação</p>
    </div>

    <form [formGroup]="forgotPasswordForm" (ngSubmit)="onSubmit()">
      <ion-item fill="outline">
        <ion-label position="stacked">Email</ion-label>
        <ion-input 
          formControlName="email"
          type="email"
          placeholder="Digite seu email">
        </ion-input>
      </ion-item>

      <ion-button 
        type="submit"
        expand="block"
        [disabled]="loading || forgotPasswordForm.invalid"
        class="submit-button">
        <ion-spinner *ngIf="loading" name="crescent" slot="start"></ion-spinner>
        {{ loading ? 'Enviando...' : 'Enviar Código' }}
      </ion-button>
    </form>

    <div class="footer-actions">
      <ion-button fill="clear" (click)="goToLogin()">
        Voltar ao Login
      </ion-button>
    </div>
  </div>
</ion-content>
